package com.example.foodielog;public class Popularplace_getset {    private String restaurent_image;    private String restaurent_name;    private String review;    private String txt_ratenumber;    public Popularplace_getset() {        this.restaurent_image = restaurent_image;        this.restaurent_name = restaurent_name;        this.review = review;        this.txt_ratenumber = txt_ratenumber;    }    public String getRestaurent_image() {        return restaurent_image;    }    public void setRestaurent_image(String restaurent_image) {        this.restaurent_image = restaurent_image;    }    public String getRestaurent_name() {        return restaurent_name;    }    public void setRestaurent_name(String restaurent_name) {        this.restaurent_name = restaurent_name;    }    public String getReview() {        return review;    }    public void setReview(String review) {        this.review = review;    }    public String getTxt_ratenumber() {        return txt_ratenumber;    }    public void setTxt_ratenumber(String txt_ratenumber) {        this.txt_ratenumber = txt_ratenumber;    }}